import dishes from './specialDishes.json'; 
import ButtonOrder from '../../buttons/ButtonOrder';

function SpecialDishes() {
    return (
        <section>
            {
                dishes.map(dish => {
                    return (<div className="swiper-slide slide">
                        <div className="content">
                            <span>{dish.topic}</span>
                            <h3>{dish.name}</h3>
                            <p>{dish.description}</p>
                            <ButtonOrder />
                        </div>
                        <div className="image">
                            <img src={dish.img} alt={dish.id} />
                        </div>
                    </div>
                )})
            }
        </section>

    )
}

export default SpecialDishes;
